import styled from "styled-components";

export const NavbarWrap = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;

  .iconReact,
  .iconReactNav {
    padding: 2rem;
    font-size: 2rem;

    &:hover {
      cursor: pointer;
    }
  }

  .iconReactNav {
    border-bottom: 1px solid #e5e5e5;
  }
`;

